class ExampleClass extends Component {

    render() {
        return (
            <div>
                <h1>This is {this.props.title}'s Website!</h1>
            </div>
        )
    }
}

ExampleClass.defaultProps = {
    title: "GeeksforGeeks"
}

export default ExampleClass;
